import React from 'react';
import './landing.scss'
import Nav from './containers/Nav';
import Home from './views/Home';

const Landing = (props) => {
  return (
    <>
      <main className={"landing"}>
        <Nav />
        <Home/>
      </main>
    </>
  )
}
export default Landing;
